INSERT INTO `sys_oper_log` VALUES ('780', '通知公告', '2', 'com.ruoyi.web.controller.system.SysNoticeController.editSave()', 'POST', '1', 'admin', '财政部', '/system/notice/edit', '127.0.0.1', '内网IP', '{\r\n  \"noticeId\" : [ \"1\" ],\r\n  \"noticeTitle\" : [ \"公告\" ],\r\n  \"noticeType\" : [ \"2\" ],\r\n  \"noticeContent\" : [ \"<div class=\\\"para\\\" label-module=\\\"para\\\" style=\\\"font-size: 14px; word-wrap: break-word; color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 28px; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif;\\\">2018年6月20日，世界品牌实验室（World Brand Lab）在北京发布了2018年《中国500最具价值品牌》分析报告。腾讯居第二位。2018年12月，世界品牌实验室编制的《2018世界品牌500强》揭晓，排名第39。<span class=\\\"sup--normal\\\" data-sup=\\\"4\\\" data-ctrmap=\\\":4,\\\" style=\\\"font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em; margin-left: 2px; color: rgb(51, 102, 204); cursor: pointer; padding: 0px 2px;\\\">&nbsp;[4]</span><a class=\\\"sup-anchor\\\" name=\\\"ref_[4]_1591\\\" style=\\\"background-color: rgb(255, 255, 255); color: rgb(19, 110, 194); position: relative; top: -50px; font-size: 0px; line-height: 0;\\\">&nbsp;</a>&nbsp;2019年7月，发布2019《财富》世界500强：位列237位。<br></div>\" ],\r\n  \"status\" : [ \"0\" ]\r\n}', '0', null, '2019-11-26 16:15:41');
INSERT INTO `sys_oper_log` VALUES ('781', '通知公告', '2', 'com.ruoyi.web.controller.system.SysNoticeController.editSave()', 'POST', '1', 'admin', '财政部', '/system/notice/edit', '127.0.0.1', '内网IP', '{\r\n  \"noticeId\" : [ \"2\" ],\r\n  \"noticeTitle\" : [ \"维护通知：2018-07-01 LHP狗太管理系统凌晨维护\" ],\r\n  \"noticeType\" : [ \"1\" ],\r\n  \"noticeContent\" : [ \"<div style=\\\"text-indent: 28px;\\\"><font color=\\\"#333333\\\" face=\\\"arial, 宋体, sans-serif\\\"><span style=\\\"font-size: 14px;\\\">如现在用户需要存储一个地址信息。根据评估，只要使用100个字符就可以了。但是有些数据库管理员会认为，反正Varchar数据类型是根据实际的需要来分配长度的。还不如给其大一点的呢。为此他们可能会为这个字段一次性分配200个字符的存储空间。这VARCHAR(100)与VARCHAR(200)真的相同吗?结果是否定的。虽然他们用来存储90个字符的数据，其存储空间相同。但是对于内存的消耗是不同的。对于VARCHAR数据类型来说，硬盘上的存储空间虽然都是根据实际字符长度来分配存储空间的，但是对于内存来说</span></font></div><div style=\\\"text-indent: 28px;\\\"><br></div>\" ],\r\n  \"status\" : [ \"0\" ]\r\n}', '0', null, '2019-11-26 16:16:06');
INSERT INTO `sys_oper_log` VALUES ('782', '通知公告', '2', 'com.ruoyi.web.controller.system.SysNoticeController.editSave()', 'POST', '1', 'admin', '财政部', '/system/notice/edit', '127.0.0.1', '内网IP', '{\r\n  \"noticeId\" : [ \"2\" ],\r\n  \"noticeTitle\" : [ \"维护通知：2018-07-01 LHP狗太管理系统凌晨维护\" ],\r\n  \"noticeType\" : [ \"1\" ],\r\n  \"noticeContent\" : [ \"<div style=\\\"text-indent: 28px;\\\"><font color=\\\"#333333\\\" face=\\\"arial, 宋体, sans-serif\\\"><span style=\\\"font-size: 14px;\\\">如现在用户需要存储一个地址信息。根据评估，只要使用100个字符就可以了。但是有些数据库管理员会认为，反正Varchar数据类型是根据实际的需要来分配长度的。还不如给其大一点的呢。为此他们可能会为这个字段一次性分配200个字符的存储空间。这VARCHAR(100)与VARCHAR(200)真的相同吗?结果是否定的。虽然他们用来存储90个字符的数据，其存储空间相同。但是对于内存的消耗是不同的。对于VARCHAR数据类型来说，硬盘上的存储空间虽然都是根据实际字符长度来分配存储空间的，但是对于内存来说</span></font><span style=\\\"color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px;\\\">如现在用户需要存储一个地址信息。根据评估，只要使用100个字符就可以了。但是有些数据库管理员会认为，反正Varchar数据类型是根据实际的需要来分配长度的。还不如给其大一点的呢。为此他们可能会为这个字段一次性分配200个字符的存储空间。这VARCHAR(100)与VARCHAR(200)真的相同吗?结果是否定的。虽然他们用来存储90个字符的数据，其存储空间相同。但是对于内存的消耗是不同的。对于VARCHAR数据类型来说，硬盘上的存储空间虽然都是根据实际字符长度来分配存储空间的，但是对于内存来说</span></div><div style=\\\"text-indent: 28px;\\\"><br></div>\" ],\r\n  \"status\" : [ \"0\" ]\r\n}', '0', null, '2019-11-26 16:16:20');
INSERT INTO `sys_oper_log` VALUES ('783', '通知公告', '2', 'com.ruoyi.web.controller.system.SysNoticeController.editSave()', 'POST', '1', 'admin', '财政部', '/system/notice/edit', '127.0.0.1', '内网IP', '{\r\n  \"noticeId\" : [ \"1\" ],\r\n  \"noticeTitle\" : [ \"公告\" ],\r\n  \"noticeType\" : [ \"2\" ],\r\n  \"noticeContent\" : [ \"<div class=\\\"para\\\" label-module=\\\"para\\\" style=\\\"font-size: 14px; word-wrap: break-word; color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 28px; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif;\\\">如现在用户需要存储一个地址信息。根据评估，只要使用100个字符就可以了。但是有些数据库管理员会认为，反正Varchar数据类型是根据实际的需要来分配长度的。还不如给其大一点的呢。为此他们可能会为这个字段一次性分配200个字符的存储空间。这VARCHAR(100)与VARCHAR(200)真的相同吗?结果是否定的。虽然他们用来存储90个字符的数据，其存储空间相同。但是对于内存的消耗是不同的。对于VARCHAR数据类型来说，硬盘上的存储空间虽然都是根据实际字符长度来分配存储空间的，但是对于内存来说<br></div>\" ],\r\n  \"status\" : [ \"0\" ]\r\n}', '0', null, '2019-11-26 16:16:27');
INSERT INTO `sys_oper_log` VALUES ('784', '通知公告', '2', 'com.ruoyi.web.controller.system.SysNoticeController.editSave()', 'POST', '1', 'admin', '财政部', '/system/notice/edit', '127.0.0.1', '内网IP', '{\r\n  \"noticeId\" : [ \"10\" ],\r\n  \"noticeTitle\" : [ \"快来看看\" ],\r\n  \"noticeType\" : [ \"2\" ],\r\n  \"noticeContent\" : [ \"<p style=\\\"text-indent: 28px; \\\"><font color=\\\"#333333\\\" face=\\\"arial, 宋体, sans-serif\\\"><span style=\\\"font-size: 14px;\\\">从碎片角度进行考虑，使用CHAR字符型时，由于存储空间都是一次性分配的。为此某个字段的内容，其都是存储在一起的。单从这个角度来讲，其不存在碎片的困扰。而可变长度的字符数据类型，其存储的长度是可变的。当其更改前后数据长度不一致时，就不可避免的会出现碎片的问题。故使用可变长度的字符型数据时，数据库管理员要时不时的对碎片进行整理。如执行数据库导出导入作业，来消除碎片。</span></font></p><p style=\\\"text-indent: 28px; \\\"><font color=\\\"#333333\\\" face=\\\"arial, 宋体, sans-serif\\\"><span style=\\\"font-size: 14px;\\\">2、考虑其长度的是否相近，如果某个字段其长度虽然比较长，但是其长度总是近似的，如一般在90个到100个字符之间，甚至是相同的长度。此时比较适合采用CHAR字符类型。比较典型的应用就是MD5哈希值。当利用MD5哈希值来存储用户密码时，就非常使用采用CHAR字符类型。因为其长度是相同的。另外，像用来存储用户的身份证号码等等，一般也建议使用CHAR类型的数据。</span></font></p><p style=\\\"text-indent: 28px; \\\"><font color=\\\"#333333\\\" face=\\\"arial, 宋体, sans-serif\\\"><span style=\\\"font-size: 14px;\\\">另外请大家考虑一个问题，CHAR(1)与VARCHAR(1)两这个定义，会有什么区别呢?虽然这两个都只能够用来保存单个的字符，但是VARCHAR要比CHAR多占用一个存储位置。这主要是因为使用VARCHAR数据类型时，会多用1个字节用来存储长度信息。这个管理上的开销char字符类型是没有的</span></font></p>\" ],\r\n  \"status\" : [ \"0\" ]\r\n}', '0', null, '2019-11-26 16:16:45');
