INSERT INTO `sys_oper_log` VALUES ('1058', '通知公告', '1', 'com.ruoyi.web.controller.system.SysNoticeController.addSave()', 'POST', '1', 'admin', '财政部', '/system/notice/add', '127.0.0.1', '内网IP', '{\r\n  \"noticeTitle\" : [ \"张一博牛逼\" ],\r\n  \"noticeType\" : [ \"1\" ],\r\n  \"noticeContent\" : [ \"<p><span style=\\\"color: rgb(51, 51, 51); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Microsoft YaHei&quot;, arial, 宋体, sans-serif, tahoma; font-size: 16px;\\\">据说，我出生时，天空的北方出现祥云一片，渐渐由远而近，飘到我家房屋后幻化成一个字：帅！</span><br style=\\\"content: &quot;&quot;; display: block; width: 705px; height: 0px; margin: 20px 0px; color: rgb(51, 51, 51); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Microsoft YaHei&quot;, arial, 宋体, sans-serif, tahoma; font-size: 16px;\\\"><br style=\\\"content: &quot;&quot;; display: block; width: 705px; height: 0px; margin: 20px 0px; color: rgb(51, 51, 51); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Microsoft YaHei&quot;, arial, 宋体, sans-serif, tahoma; font-size: 16px;\\\"><span style=\\\"color: rgb(51, 51, 51); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Microsoft YaHei&quot;, arial, 宋体, sans-serif, tahoma; font-size: 16px;\\\">　　爸爸见到我后，声嘶力竭地哭了一个半月，他打死也不相信是我他的染色体遗传下来的孩子，几次携刀冲到我母亲的床前，挥舞着说要把我斩成肉泥，母亲</span><span style=\\\"color: rgb(51, 51, 51); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Microsoft YaHei&quot;, arial, 宋体, sans-serif, tahoma; font-size: 16px;\\\">以死相护，我才得以存活。爷爷的</span><a href=\\\"https://www.baidu.com/s?wd=%E9%9D%92%E5%85%89%E7%9C%BC&amp;tn=SE_PcZhidaonwhc_ngpagmjz&amp;rsv_dl=gh_pc_zhidao\\\" target=\\\"_blank\\\" class=\\\"baidu-highlight\\\" style=\\\"color: rgb(63, 136, 191); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Microsoft YaHei&quot;, arial, 宋体, sans-serif, tahoma; font-size: 16px; background-color: rgb(255, 255, 255);\\\">青光眼</a><span style=\\\"color: rgb(51, 51, 51); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Microsoft YaHei&quot;, arial, 宋体, sans-serif, tahoma; font-size: 16px;\\\">十几年了，一米开外分不清是人是狗，可是，当我出现在他眼前的时候，老人家老泪纵横，自戳双目，从此不见天日，说是不想再见到人，以免后患无穷。后来，母亲为了证明自己的清白，拉着父亲要去医院作</span><a href=\\\"https://', '0', null, '2019-11-28 12:32:32');
